double lowerBound(vector<pair<double, double>> &v, double ab)
{
    int low = 0, high = v.size();
    int ans = v.size();
    while (low <= high)
    {
        int mid = (low + high) >> 1;
        if (v[mid].first >= ab)
        {
            ans = mid;
            high = mid - 1;
        }
        else
        {
            low = mid + 1;
        }
    }
    return ans;
}

double x_value(double d, double D, double load, double p)
{
    double y = (load * 1000 / (25 * D * D));
    double r = (d / D);
    if (r <= 0.05)
    {
        auto it = lowerBound(m1[p], y);
        if (it == m1[p].size())
        {
            return 1e5;
        }
        else
        {
            auto x = m1[p].at(it).second * 25 * D * D * D;
            return x;
        }
    }
    else if (r > 0.05 && r <= 0.10)
    {
        auto it = lowerBound(m2[p], y);
        if (it == m2[p].size())
        {
            return 1e5;
        }
        else
        {
            auto x = m2[p].at(it).second * 25 * D * D * D;
            return x;
        }
    }
    else if (r > 0.10 && r <= 0.15)
    {
        auto it = lowerBound(m3[p], y);
        if (it == m3[p].size())
        {
            return 1e5;
        }
        else
        {
            auto x = m3[p].at(it).second * 25 * D * D * D;
            return x;
        }
    }
    else
    {
        auto it = lowerBound(m4[p], y);
        if (it == m4[p].size())
        {
            return 1e5;
        }
        else
        {
            auto x = m4[p].at(it).second * 25 * D * D * D;
            return x;
        }
    }
}

